  return (
    <div className="py-5">
      <div className="container">
        <div className="row">
          <div className="col-12">
            <Detail />
          </div>
          <div className="col-12 mt-5">
            <ShowTimes />
          </div>
        </div>
      </div>
    </div>
  );
}
